    // 저장할 값들
    // 1. 전체 (내 퍼소널리티에 맞는) 아이템들
    // 2. 내 즐겨찾기 아이템들
    // 3. 내 좋아요/싫어요 아이템들
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return (
    <div>
      <RefreshButton />
      <FeedItems />
      <FeedFooter />
    </div>
  );
};

export default Feed;
